def printBlocks(blocks):
  j = 0
  k = ''
  while j < len(blocks):
    k= k + blocks[j]
    if (j + 1) % 32 == 0:
      k += '\n'
    j= j + 1
  print(k)


def addBlocks(firstBlock, secondBlock):
  combinedBlocks = ''
  j = 0;
  while j < len(firstBlock):
    if(firstBlock[j] == '1' or secondBlock[j] == 1):
      combinedBlocks = combinedBlocks + '1'
    else:
      combinedBlocks = combinedBlocks + '0'
    j = j + 1

printBlocks(blocks)
